import React from 'react';

export default function features(){
    return(
        <div id='features'>
                <h5 className='featuresHeader'>妙味特色</h5>
                <div className='diamond'>
                    <i className='iconfont icon-diamond'></i>
                    <span>成为VIP会员后，即刻观看'妙味VIP视屏库中任何视频'</span>
                </div>
        </div>
    )
}
